import React from 'react';
import './Card.css';

import { Circle, MoreHorizontal } from 'react-feather';

const Card = (props) => {
  return (
    <div className='card'>
      <div className='card-top'>
        <p className='card-title'>{props.ticket.id}</p>
        {/* <img src="https://www.freepik.com/free-vector/illustration-businessman_2606517.htm#query=user%20logo&position=1&from_view=keyword&track=ais" className='profile-pic' alt='profile-pic' /> */}
        <img src="https://www.freepik.com/free-vector/illustration-businessman_2606517.htm#query=user%20logo&position=1&from_view=keyword&track=ais" alt="no" />
      </div>
      <div className='card-middle'>
        <p className='card-desc bold'>{props.ticket.title}</p>
      </div>
      <div className='card-bottom'>
        <div className='component-1 pointer'>
          <MoreHorizontal className='icon' />
        </div>
        <div className='component-2 pointer'>
          <Circle className='icon' />
          <p>{props.ticket.tag[0]}</p>
        </div>
      </div>
    </div>
  );
};

export default Card;
